import React from 'react';

const Footer = () => {
    return (
        <footer style={{ 
            background: 'rgba(255, 255, 255, 0.95)', 
            padding: '1rem', 
            textAlign: 'center', 
            marginTop: '2rem' 
        }}>
            <p>&copy; 2025 Marta Cuevas. Todos los derechos reservados.</p>
        </footer>
    );
};

export default Footer;
